    <Collapse
      expandIcon={({ isActive }) => <CaretDownOutlined rotate={isActive ? 180 : 0} />}
      expandIconPosition="right"
    >
      <Panel key="1" header="Цена">
        test
      </Panel>
    </Collapse>
  </div>
);

export default PriceSelect;
